	if err != nil {
		return nil, err
	}

	httpAliveResponse := new(HTTPAliveResponse)
	httpAliveResponse.Body = body
	httpAliveResponse.StatusCode = rsp.StatusCode
	httpAliveResponse.Header = rsp.Header
	return httpAliveResponse, nil
}

