	tx, err := cr.DB.Begin(queries)
	if err != nil {
		if tx != nil {
			tx.Rollback()
		}
		if err == neoism.TxQueryError {
			txErr := rwapi.ConstraintOrTransactionError{Message: err.Error()}
			for _, e := range tx.Errors {
				txErr.Details = append(txErr.Details, e.Message)
			}
			err = txErr
		}
		return err
	}
	return tx.Commit()
