		return token.Error()
	}

	l.weather = make(chan weather.Readings, 5)
	go func() {
		for {
			select {
			case waitc := <-l.closing:
				l.client.Unsubscribe(topic)
				l.client.Disconnect(250)
				close(l.weather)
